import React, { useState, useEffect } from "react";
import { useParams } from "react-router-dom";
import "./StockDetails.css";
import { Tab, Tabs, Box, Button, Modal } from "@mui/material";
import { TabContext, TabPanel, TabList } from "@mui/lab";
import NewsDetailsComponent from "./NewsDetails";
import Highcharts from 'highcharts'
import HighchartsReact from 'highcharts-react-official'

function StockDetailsComponent() {
  const { id } = useParams();
  const [tickerData, setTickerData] = useState(null);
  const [iexData, setIexData] = useState(null);
  const [newsData, setNewsData] = useState(null);
  const [dailyChart, setDailyChartInfo] = useState(null);
  const [value, setValue] = useState("1");

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  const options = {
    title: {
      text: 'Company name'
    },
    series: [{
      data: [1, 2, 3]
    }]
  }



  useEffect(() => {
    // Perform API call here and set the data
    // http://localhost:8080/ticker/NVDA
    // fetch(`http://localhost:8080/ticker/${id}`)
    //   .then((response) => response.json())
    //   .then((data) => {
    //     setTickerData(data);
    //     console.log("Data: ");
    //     console.log(data);
    //   });
    // fetch(`http://localhost:8080/iex/${id}`)
    // .then((response) => response.json())
    // .then((data) => {
    //   setIexData(data);
    //   console.log("IEX Data: ");
    //   console.log(data);
    // });
    fetch(`http://localhost:8080/news/${id}`)
    .then((response) => response.json())
    .then((data) => {
      setNewsData(data);
      console.log("News: ");
      console.log(data);
    });

    // fetch(`http://localhost:8080/dailyChart/${id}`)
    // .then((response) => response.json())
    // .then((data) => {
    //   setDailyChartInfo(data);
    //   console.log("Daily Chart: ");
    //   console.log(data);
    // });

  }, [id]);

  const [show, setShow] = useState(false);
  const handleClose = () => setShow(false);
  const handleShow = () => setShow(true);

  const onBuyClick = (id) => {
    console.log("Buy button clicked" + id);
  }

  const closeBuyModal = () => {
    console.log("Buy modal closed");
  }


  return (
    <div>
      {/* {tickerData && ( */}
      <div className="container resultPage">
        <div className="row">
          <div className="col leftCol">
            <div className="container companyData">
              <div className="row">
                <div className="col">
                  <h1>
                    ticker
                    {/* {tickerData['ticker']} */}
                  </h1>
                </div>
                <div className="col">
                  <h5>
                    {/* {id} */}
                    fav_btn
                  </h5>
                </div>
              </div>

              <div className="row">
                <h3>
                  name
                  {/* {tickerData['name']} */}
                </h3>
              </div>

              <div className="row">
                <h5>
                  exchangecode
                  {/* {tickerData['exchangeCode']} */}
                </h5>
              </div>

              <div className="row">
                <Button variant="contained" color="success" style={{maxWidth:"10px", marginLeft:"10px"}}
                  onClick={()=>onBuyClick("id")}>
                  Buy
                </Button>
              </div>
            </div>
          </div>


{/* Modal for buying stocks */}
      {/* <Modal show={show} onHide={() => closeBuyModal()}> */}
      <Modal show={show} onHide={cardCloseHandler}>
        <Modal.Header closeButton>
          <Modal.Title>

          </Modal.Title>
        </Modal.Header>
        <Modal.Body>Woohoo, you are reading this text in a modal!</Modal.Body>
        <Modal.Footer>
          <Button variant="secondary" onClick={cardCloseHandler}>
            Close
          </Button>
          <Button variant="primary" onClick={cardCloseHandler}>
            Save Changes
          </Button>
        </Modal.Footer>
      </Modal> 


          <div className="col rightCol">
            <div className="container stockValues">
              <div className="row justify-content-end">
                <h1>
                  {/* {id} */}
                  Stock Value
                </h1>
              </div>
              <div className="row justify-content-end">
                <h3>
                  {/* {id} */}
                  Stock Points
                </h3>
              </div>
              <div className="row justify-content-end">
                <h6>
                  {/* {id} */}
                  get current time
                </h6>
              </div>
            </div>
          </div>
        </div>

        {/* Tabs */}
        <Box sx={{ width: "100%", typography: "body1", marginTop: "40px" }}>
          <TabContext value={value}>
            <Box
              sx={{
                borderBottom: 1,
                borderColor: "divider",
                display: "flex",
                justifyContent: "center",
              }}
            >
              <TabList
                onChange={handleChange}
                sx={{
                  justifyContent: "space-evenly",
                  width: "100%",
                  maxWidth: "1000px",
                }}
              >
                <Tab label="Summary" value="1" sx={{ flex: 1 }} />
                <Tab label="Top News" value="2" sx={{ flex: 1 }} />
                <Tab label="Charts" value="3" sx={{ flex: 1 }} />
              </TabList>
            </Box>
            <TabPanel value="1">
              Summary
              <div className="container">
                <div className="row summary_content">
                  <div className="col summary_data">
                    <div className="row summary_data_price">
                      <div className="col price_closed"></div>
                      <div className="col price_open"></div>
                    </div>

                    <div className="row summary_data_dec">
                      <h2>Company's Decription</h2>
                      <p> date: afkjs Company's Decription</p>
                    </div>
                  </div>

                  <div className="col summary_charts">
                  <HighchartsReact
                    highcharts={Highcharts}
                    options={options}
                  />
                  </div>
                </div>
              </div>
            </TabPanel>
            <TabPanel value="2">News
            {newsData && (
            <NewsDetailsComponent
                // newsData={[
                //   { id: 1, title: "Article 1" },
                //   { id: 2, title: "Article 2" },
                //   { id: 3, title: "Article 3" },
                // ]}
                newsData={newsData.articles}
            />
            )}
            </TabPanel>
            <TabPanel value="3">Web Development</TabPanel>
          </TabContext>
        </Box>
      </div>
      {/* )} */}
    </div>
  );
}

export default StockDetailsComponent;
